import Link from "next/link";

function AboutPage() {
  return (
    <div>
      <nav>
      <Link href="/">
        <a className="nav-link">Home</a>
      </Link>
      <Link href="/about">
        <a className="nav-link">About</a>
      </Link>
    </nav>
      <h1>About</h1>
    </div>
  );
}

export default AboutPage;
